### 1. Loop Unrolling
Loop unrolling is a technique where the compiler duplicates the loop body multiple times to reduce the overhead of loop control.

**Example:**
```c
// Original code
for (int i = 0; i < 10; i++) {
    array[i] = i * 2;
}

// Optimized code with loop unrolling
array[0] = 0 * 2;
array[1] = 1 * 2;
