void playMorse(const char* morse) {
  for (int i = 0; morse[i] != '\0'; i++) {
    if (morse[i] == '.') {
      playDot();
    } else if (morse[i] == '-') {
      playDash();
    }
    delay(dotDuration); // symbol space
  }
  delay(dotDuration * 3); // letter space
}

void playDot() {
  tone(buzzerPin, 1000, dotDuration);
  delay(dotDuration);
}

void playDash() {
  tone(buzzerPin, 1000, dotDuration * 3);
  delay(dotDuration * 3);
}
